import { useState } from 'react'

const App = () => {
  const [value, setValue] = useState(10)

  const setToValue = (newValue) => () => {
     console.log('value now', newValue)
     setValue(newValue)
  }

  return (
    <div>
      {value}
      <button onClick={setToValue(1000)}>1k</button>
      <button onClick={setToValue(0)}>reset</button>
      <button onClick={setToValue(value + 1)}>increase by one</button>
    </div>
  )
}

export default App
